ef="#nowhere">Узнать больше</a></li><li class="courses__item"><h3 class="courses__name">Итальянский</h3><img class="courses__img" src="images/italian.svg" alt="Итальянский язык" width="317" height="317"><p class="courses__desc">Жаркий язык страсти. Почти как Тамерлан только европеец.</p><a class="button courses__link" href="#nowhere">Узнать больше</a></li><li class="courses__item"><h3 class="courses__name">Французский</h3><img class="courses__img" src="images/french.svg" alt="Французский язык" width="317" height="317"><p class="courses__desc">Попробуй суши такими, какими они должны быть — под сакурой над головой и фильмами-хентай по телевизору.</p><a class="button courses__link" href="#nowhere">Узнать больше</a></li></ul></section><section class="features"><h2 class="title title--special features__title">Почему Smart Lang?</h2><p class="title features__land">Школа иностранных языков открывает для тебя мир</p><ul class="features__list"><li class="features__item features__item--skilled"><img class="features__icon" src="images/skilled.png" width="70" height="70"><h3 class="features__name">Профессиональные учителя</h3><p class="features__desc">В нашей школе работают лучше профессиналы своего дела...</p></li><li class="features__item features__item--unique"><img class="features__icon" src="images/unique.png" width="50" height="50"><h3 class="features__name">Уникальные материалы и методики</h3><p class="features__desc">Какой-то текст</p></li><li class="features__item features__item--geo"><img class="features__icon" src="images/geo.png" width="50" height="50"><h3 class="features__name">Можно учиться из любой локации</h3><p class="features__desc">Какой-то текст</p></li><li class="features__item features__item--schedule"><img class="features__icon" src="images/schedule.png" width="50" height="50"><h3 class="features__name">Удобное расписание</h3><p class="features__desc">Какой-то текст</p></li><li class="features__item features__item--adapt"><img class="features__icon" src="images/adapt.png" width="50" height="50"><h3 class="features__name">Погружение и адаптация</h3><p class="features__desc">Какой-то текст</p></li><li class="features__item features__item--price"><img class="features__icon" src="images/price.png" width="50" height="50"><h3 class="features__name">Комфортные цены</h3><p class="features__desc">Какой-то текст</p></li></ul></section><section class="testimonials"><div class="testimonials__wrapper"><h2 class="title testimonials__title">Отзывы</h2><p class="testimonials__text">Прекрасная школа, честное слово. Ну просто шикардоз мазафака. Ай спик инглиш вери гуд райт нау.</p><div class="testimonials__student"><p class="testimonials__student-name">Тамерлан Агаев</p><p class="testimonials__student-details">Санкт-Петербург, 27</p></div></div><a class="button button--wide testimonials__button" href="#nowhere">Выбрать учителя</a></section></main><section class="footer"><h2 class="title footer__title visually-hidden">Наши контакты</h2></section><script src="js/script.js"></script></body></html>